

#-- Change to other preferred database, if required
DROP database IF EXISTS orders_new;

CREATE database orders_new;

use orders_new;
  DROP TABLE IF EXISTS  PAYMENT;
  DROP TABLE IF EXISTS  PRODUCT;
  DROP TABLE IF EXISTS  ORDER1 ;
  DROP TABLE IF EXISTS  ITEMS;
  DROP TABLE IF EXISTS  ORDER_REVIEW;
  DROP TABLE IF EXISTS  SELLER;
  DROP TABLE IF EXISTS  CUSTOMER;
  DROP TABLE IF EXISTS  LOCATION;

#-------------------------------------------------------
#--  DDL for Table PAYMENT
#-------------------------------------------------------

  CREATE TABLE PAYMENT 
   (	ORDER_ID VARCHAR(50), 
		PAYMENT_SEQUENTIAL INT(6), 
		PAYMENT_TYPE VARCHAR(30), 
		PAYMENT_INSTALLMENTS INT(6),
		PAYMENT_VALUE DECIMAL(10,2) 
   ) ;
#-------------------------------------------------------
#--  DDL for Table PRODUCT
#-------------------------------------------------------

  CREATE TABLE PRODUCT 
   (	PRODUCT_ID VARCHAR(50), 
		PRODUCT_NAME_LENGHT VARCHAR(30),
		PRODUCT_DESCRIPTION_LENGHT INT(6),
		PRODUCT_PHOTOS_QTY INT(6), 
		PRODUCT_WEIGHT_G INT(6),
		PRODUCT_LENGTH_CM INT(6),
		PRODUCT_HEIGHT_CM INT(6), 
		PRODUCT_WIDTH_CM INT(6),
        PRODUCT_CATEGORY_NAME VARCHAR(50)

   ) ;
#-------------------------------------------------------
#--  DDL for Table ORDER
#-------------------------------------------------------

  CREATE TABLE ORDER1
   (	ORDER_ID VARCHAR(50), 
		CUSTOMER_ID VARCHAR(50), 
		ORDER_STATUS VARCHAR(20), 
		ORDER_PURCHASE_TIMESTAMP DATETIME, 
		ORDER_APPROVED_AT DATETIME, 	
		ORDER_DELIVERED_CARRIER_DATE DATETIME, 
		ORDER_DELIVERED_CUSTOMER_DATE DATETIME, 
		ORDER_ESTIMATED_DELIVERY_DATE DATETIME 
   ) ;
#-------------------------------------------------------
#--  DDL for Table ITEMS	
#-------------------------------------------------------

  CREATE TABLE ITEMS 
   (	ORDER_ID VARCHAR(50), 
		ORDER_ITEM__ID INT(6), 
		PRODUCT_ID VARCHAR(50), 
		SELLER_ID VARCHAR(50), 
		SHIPPING_LIMIT_DATE DATETIME, 
		PRICE DECIMAL(10,2), 
		FREIGHT_VALUE DECIMAL(10,2)
		
   ) ;
#-------------------------------------------------------
#--  DDL for Table ORDER_REVIEW
#-------------------------------------------------------

  CREATE TABLE ORDER_REVIEW
   (	REVIEW_ID VARCHAR(50), 
		ORDER_ID VARCHAR(50), 
		REVIEW_SCORE INT(6),
		REVIEW_COMMENT_TITLE VARCHAR(50),
		REVIEW_COMMENT_MESSAGE VARCHAR(270),
		REVIEW_CREATION_DATE DATETIME,
		REVIEW_ANSWER_TIMESTAMP DATETIME

		 	
   ) ;
#-------------------------------------------------------
#--  DDL for Table SELLER
#-------------------------------------------------------

  CREATE TABLE SELLER 
   (	SELLER_ID VARCHAR(50), 
		SELLER_ZIP_CODE_PREFIX INT(6), 
		SELLER_CITY VARCHAR(50), 
		SELLER_STATE VARCHAR(2)
  ) ;
#-------------------------------------------------------
#--  DDL for Table CUSTOMER
#-------------------------------------------------------

  CREATE TABLE CUSTOMER 
   (	CUSTOMER_ID VARCHAR(50), 
		CUSTOMER_UNIQUE_ID VARCHAR(50),
		CUSTOMER_ZIP_CODE_PREFIX INT(6), 
		CUSTOMER_CITY VARCHAR(50), 
		CUSTOMER_STATE VARCHAR(2)

   ) ;
#-------------------------------------------------------
#--  DDL for Table LOCATION
#-------------------------------------------------------

  CREATE TABLE LOCATION 
   (	geolocation_zip_code_prefix INT(6), 
		geolocation_lat DECIMAL(5,3), 
		geolocation_lng DECIMAL(5,3), 
		geolocation_city VARCHAR(50),
		geolocation_state VARCHAR(2)
   ) ;

